<p>Background: I'm building an app that keeps track of donations.
I creating an API in ExpressJS, and I am using Mongoose to hook up to MongoDB.</p>

<p>I have a MongoDB collection called Donations that looks like this:</p>

<pre><code>[
    {
        donor: 123,
        currency: 'CAD',
