    {
        donor: 123,
        currency: 'CAD',
        donationAmount: 50
    }
]
</code></pre>

<p>For each donor, I need to sum up the total amount of donations per currency.
Ideally I want a single MongoDB query that would produce the following dataset. (I'm flexible on the structure ... my only requirement are that in the results, 1) each donor has one and only one document, and 2) this document contains the summed total of each currency type)</p>

<pre><code>[
    {
        donor: 123,
        donations: [
            {
                CAD : 100,
