        ]
    },
    {
        donor: 789,
        donations: [
            {
                CAD: 50
            }
        ]
    },
]
</code></pre>

<p>Any ideas on the best way to do this? 
My solution right now is pretty ugly - I haven't been able to achieve it without doing multiple queries. </p>

